BrowserFileSystem.dir = function(dirspec){
  let direntries = [];
  dirspec = dirspec.replace(/\./g,"\\.")
  dirspec = dirspec.replace(/\*/g,".*")
  let re = new RegExp(dirspec);
  let keys = Object.keys(BrowserFileSystem.fs);
  for(var i = 0; i < keys.length; i++){
    let key = keys[i];
    if(key.match(re) !== null){
      direntries.push(key)
    }
  }
  return direntries.sort();
}

