    doFadeOut(args){
        let self = args.self;
        self.resetPanel(args.selectedPanel,self);
        args.fadePanel.style.opacity = 0;
        self.container.append(args.fadePanel);
        // We need to swap panels to get around a Safari bug. Doing it the
